// 506. Relative Ranks
// https://leetcode.com/problems/relative-ranks/
#include <iostream>
#include <cassert>
#include <set>
#include <map>
#include <string>
#include <vector>
#include <algorithm>
#include <iterator>
#include <functional>
using namespace std;
class Solution {
public:
	vector<string> findRelativeRanks(vector<int>& nums) {
		vector<string> result(nums.size());
		map<int, vector<size_t>, greater<int>> treeMap;
		for (size_t i = 0; i < nums.size(); i++) {
			treeMap[nums[i]].push_back(i);
		}
		size_t rank = 0;
		for (const auto &i : treeMap) {
			rank++;
			if (rank == 1) {
				for (const auto &j : i.second) {
					result[j] = "Gold Medal";
				}
				continue;
			}
			if (rank == 2) {
				for (const auto &j : i.second) {
					result[j] = "Silver Medal";
				}
				continue;				
			}
			if (rank == 3) {
				for (const auto &j : i.second) {
					result[j] = "Bronze Medal";
				}
				continue;				
			}
			if (rank >= 4) {
				for (const auto &j : i.second) {
					result[j] = to_string(rank);
				}
				continue;				
			}			
		}
		return result;
	}
};
